import react from "react";
import'../style/Square.css'

function square(props) {

    const {name, onClick, id} = props;

    if (onClick) {
        square.style.color = 'black'
        return(
            <div className="square" id ={id} onClick={onClick} >{name}</div>
        )
    } else {
        return(
            <div className="square" id ={id} onClick={onClick} >{name}</div>
        )
    }

    
}

export default square;
